module PerfTester.Commands

open System.IO.Pipelines
open System.Threading.Tasks
open Microsoft.IO
open PulsarTester.Common
open pulsar.proto
open System.IO
open ProtoBuf

type CommandType = BaseCommand.Type
[<Literal>]
let DEFAULT_MAX_MESSAGE_SIZE = 5_242_880 //5 * 1024 * 1024
let mutable seqId = 1UL
//174 msgs batch payload
let stringPayload = ""

let payload = System.Convert.FromBase64String(stringPayload)

let private serializePayloadCommand (command : BaseCommand) (metadata: MessageMetadata) (payload: byte[]) =
    (fun (output: PipeWriter) ->
        let temp = MemoryStreamManager.GetStream() :?> RecyclableMemoryStream
        let binaryWriter = new BinaryWriter(temp)

        // write fake totalLength
        for i in 1..4 do
            temp.WriteByte(0uy)

        // write commandPayload
        Serializer.SerializeWithLengthPrefix(temp, command, PrefixStyle.Fixed32BigEndian)

        let stream1Size = int temp.Length

        // write magic number 0x0e01
        temp.WriteByte(14uy)
        temp.WriteByte(1uy)

        // write fake CRC sum
        for i in 1..4 do
            temp.WriteByte(0uy)

        // write metadata
        Serializer.SerializeWithLengthPrefix(temp, metadata, PrefixStyle.Fixed32BigEndian)
        let stream2Size = int temp.Length
        let totalMetadataSize = stream2Size - stream1Size - 6

        // write payload
        temp.Write(payload, 0, payload.Length)

        let frameSize = int temp.Length
        let totalSize = frameSize - 4
        let payloadSize = frameSize - stream2Size

        let crcStart = stream1Size + 2
        let crcPayloadStart = crcStart + 4

        // write CRC
        temp.Seek(int64 crcPayloadStart, SeekOrigin.Begin) |> ignore
        let crc = int32 <| CRC32C.GetForRMS(temp, totalMetadataSize + payloadSize)
        temp.Seek(int64 crcStart, SeekOrigin.Begin) |> ignore
        binaryWriter.Write(int32ToBigEndian crc)

        // write total size
        temp.Seek(0L, SeekOrigin.Begin) |> ignore
        binaryWriter.Write(int32ToBigEndian totalSize)

        temp.Seek(0L, SeekOrigin.Begin) |> ignore
        backgroundTask {
            try
                return! temp.CopyToAsync(output)
            finally
                temp.Dispose()
                binaryWriter.Dispose()
        } :> Task
    ), command.``type``

let private serializeSimpleCommand (command : BaseCommand) =
    (fun (output: PipeWriter) ->
        use temp = MemoryStreamManager.GetStream()
        use binaryWriter = new BinaryWriter(temp)

        // write fake totalLength
        for i in 1..4 do
            temp.WriteByte(0uy)

        // write commandPayload
        Serializer.SerializeWithLengthPrefix(temp, command, PrefixStyle.Fixed32BigEndian)
        let frameSize = int temp.Length

        let totalSize = frameSize - 4

        //write total size and command size
        temp.Seek(0L,SeekOrigin.Begin) |> ignore
        binaryWriter.Write(int32ToBigEndian totalSize)
        temp.Seek(0L, SeekOrigin.Begin) |> ignore
        temp.CopyToAsync(output)
    ),  command.``type``

let newPing () : Payload =
    let response = CommandPing()
    let command = BaseCommand(``type`` = CommandType.Ping, Ping = response)
    command |> serializeSimpleCommand

let newPong () : Payload =
    let response = CommandPong()
    let command = BaseCommand(``type`` = CommandType.Pong, Pong = response)
    command |> serializeSimpleCommand

let newConnected () : Payload =
    let response = CommandConnected(
        ProtocolVersion = 15,
        ServerVersion = "PerfectTester",
        MaxMessageSize = DEFAULT_MAX_MESSAGE_SIZE
    )
    let command = BaseCommand(``type`` = CommandType.Connected, Connected = response)
    command |> serializeSimpleCommand

let newProducerSuccess requestId : Payload =
    let response = CommandProducerSuccess(
        RequestId = requestId,
        ProducerName = "PerfectTester",
        ProducerReady = true,
        SchemaVersion = [||]
    )
    let command = BaseCommand(``type`` = CommandType.ProducerSuccess, ProducerSuccess = response)
    command |> serializeSimpleCommand

let newPartitionMetadataResponse requestId : Payload =
    let response = CommandPartitionedTopicMetadataResponse(
        Partitions = 0u,
        RequestId = requestId,
        Response = CommandPartitionedTopicMetadataResponse.LookupType.Success
    )
    let command = BaseCommand(``type`` = CommandType.PartitionedMetadataResponse, partitionMetadataResponse = response)
    command |> serializeSimpleCommand

let newLookupResponse requestId : Payload =
    let response = CommandLookupTopicResponse(
        RequestId = requestId,
        Response = CommandLookupTopicResponse.LookupType.Connect,
        brokerServiceUrl = "pulsar://127.0.0.1:6650"
    )
    let command = BaseCommand(``type`` = CommandType.LookupResponse, lookupTopicResponse = response)
    command |> serializeSimpleCommand

let newSendReceipt producerId sequenceId messageId : Payload =
    let response = CommandSendReceipt(
        ProducerId = producerId,
        SequenceId = sequenceId,
        MessageId = messageId
    )
    let command = BaseCommand(``type`` = CommandType.SendReceipt, SendReceipt = response)
    command |> serializeSimpleCommand

let newSuccess requestId : Payload =
    let response = CommandSuccess(
        RequestId = requestId
    )
    let command = BaseCommand(``type`` = CommandType.Success, Success = response)
    command |> serializeSimpleCommand



let newMessage consumerId batchSize: Payload =
    let response = CommandMessage(
        ConsumerId = consumerId,
        MessageId = MessageIdData(
            ledgerId = 1UL,
            entryId = seqId
        )
    )
    let metadata = MessageMetadata(
        ProducerName = "PerfTester",
        SequenceId = seqId,
        PublishTime = 1696093979000UL,
        NumMessagesInBatch = batchSize
    )
    seqId <- seqId + 1UL
    let command = BaseCommand(``type`` = CommandType.Message, Message = response)
    serializePayloadCommand command metadata payload